import { NavLink } from "react-router-dom";
import "../StylePages/StyleHome/Header.css";

const Header = () => {
  return (
    <div className="head1">
      <h1>ANY DRINK</h1>
      <ul>
        <li>
          <NavLink to="/">Home</NavLink>
        </li>
        <li>
          <NavLink to="/service">Service</NavLink>
        </li>
        <li>
          <NavLink to="/about">About</NavLink>
        </li>
      </ul>
    </div>
  );
};

export default Header;
